import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import {
  Home,
  login,
  MovieDetail,
  MovieList,
  ProfileList,
  ProfileCreate,
  ShowMovie,
  Signup
} from "./pages";
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<MovieDetail />}/>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
